package main

import (
	"fmt"

	"github.com/insabelter/IWS_GO_Solutions/models"
)

func main() {
	result, message := models.NewRating(2, "good")
	fmt.Println(result)
	fmt.Println(message)

	resultb, messageb := models.NewRating(13, "bad")
	fmt.Println(resultb)
	fmt.Println(messageb)

	resultc, messagec := models.NewRatingPointer(3, "This is a   feedback")
	fmt.Println(resultc)
	fmt.Println(messagec)

	result.ChangeRating(3, "better")
	fmt.Println(result)
}
